COSBase cosBase = acquireItem( j );
if( cosBase instanceof COSFloat )
{
    result[j] = ((COSFloat)cosBase).floatValue();
}
else if( cosBase instanceof COSInteger )
{
    result[j] = ((COSInteger)cosBase).intValue();
}

Object item = acquireItem( j );
if( item instanceof COSNumber )
{
    COSNumber cosNumber = (COSNumber)item;
    result[j] = cosNumber.floatContent();
}

